import { useParams } from 'react-router-dom'
import { fetchAPI, initUrl } from '../services/fetchData'
import React, { useState, useEffect } from 'react'
function Details() {
    const { id } = useParams()
    const [ character, setCharacter ] = useState()
    useEffect(() => {
        fetchAPI(`${initUrl}/${id}`)
          .then((data) => {
            setCharacter(data.results);
          })
          .catch((err) => {
            console.error(err);
          });

        console.log(character);
    }, [])
    console.log(id)

    return (
        <div>
            <h1>Hola que tal</h1>
        </div>
    )
}

export default Details
